import "./style.css";
import React from 'react';
import {Switch,Route} from 'react-router';
import Homepage from "./components/homepage";

export default function App() {
    return(
        <div>
            <Switch>
                <Route path='\' component={Homepage} />   
            </Switch>
        </div>
    ); }
